// Import Bootstrap CSS in the entry point file (e.g., index.js or App.js) to avoid repeated imports
import React, { useState } from "react";
import TaskDialog from "./TaskDialog";
// ... (rest of your imports)

function TaskTable() {
  const [showDialog, setShowDialog] = useState(false);

  const handleShowDialog = () => {
    setShowDialog(true);
  };

  const handleCloseDialog = () => {
    setShowDialog(false);
  };

  // Add the handleSave function here if you're managing tasks state in this component.
  const handleSave = (newTask) => {
    // Logic to save the new task
    setShowDialog(false);
  };

  return (
    <div className="container mt-5">
      <div className="row mb-3 align-items-center">
        <div className="col-md-6 col-sm-12 text-md-center text-sm-left">
          <h2>Frameworks</h2>
        </div>
        <div className="col-md-6 col-sm-12 text-md-right text-sm-left">
          <button className="btn btn-primary" onClick={handleShowDialog}>
            Add
          </button>
        </div>
      </div>
      <TaskDialog
        show={showDialog}
        handleClose={handleCloseDialog}
        handleSave={handleSave}
        taskData={null} // You can pass existing task data if editing or null if adding a new task
      />
      {/* Table and other content below */}
      <table className="table table-bordered">
        <thead className="thead-dark">
          <tr>
            <th>Title</th>
            <th>Description</th>
            <th>Deadline</th>
            <th>Priority</th>
            <th>Is Complete</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>{/* Table rows go here */}</tbody>
      </table>

      <TaskDialog />
    </div>
  );
}

export default TaskTable;
